  7,\n\t\"tags\": [],\n\t\"title\": \"AFSC/ABL: Embryonic development of quillback
  rockfish\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2016-05-31T01:08:20.198144\",\n\t\"name\":
  \"afsc-abl-embryonic-development-of-quillback-rockfish\",\n\t\"isopen\": false,\n\t\"url\":
  null,\n\t\"notes\": \"Maternal effects on the quality of progeny can have direct
  impacts on population productivity. Rockfish are viviparous and the oil globule
  size of larvae at parturition has been shown to have direct effects on time until
  starvation and growth rate. We sampled embryos and preparturition larvae opportunistically
  from 89 gravid quillback rockfish (Sebastes maliger) in Southeast Alaska. Because
  the developmental stage and sampling period were correlated with oil globule size,
  they were treated as covariates in an analysis of maternal age, length, and weight
  effects on oil globule size. Maternal factors were related to developmental timing
  for almost all sampling periods, indicating that older, longer, and heavier females
  develop embryos earlier than younger, shorter, or lighter ones. Oil globule diameter
  and maternal length and weight were statistically linked, but the relationships
  may not be biologically significant. Weight-specific fecundity did not increase
  with maternal size or age, suggesting that reproductive output does not increase
  more quickly as fish age and grow. Age or size truncation of a rockfish population,
  in which timing of parturition is related to age and size, could result in a shorter
  parturition season. This shortening of the parturition season could make the population
  vulnerable to f luctuating environmental conditions.\",\n\t\"license_title\": null,\n\t\"extras\":
